    console.log(getAttToEdit?.switchShowFilter == 0 ? false : true);
    setChangeRadio(getAttToEdit?.switchShowFilter == 0 ? false : true);
  }, [getAttToEdit, changeRadio]);

  return (
    <div className="form-check form-switch pt-4">
      <FastField
        value={changeRadio}
        onChange={(e) => {
          setChangeRadio(changeRadio + 1);
          console.log(e.target.value);
          console.log(changeRadio);
        }}
        id={name}
        name={name}
        type="checkBox"
        className=" pointer"
